if (typeof mraid != "undefined") {
	var scr = document.createElement("script");
	scr.src = "mraid.js"
	document.head.append(scr);
	if (mraid.getState() === 'loading') {
		mraid.addEventListener('ready', function(){mraid.useCustomClose(true);});
	} else {
		mraid.useCustomClose(true);
	}
}

// close function
function APNInterstitialClose(){
	if (typeof mraid === "undefined"){ // in case we are not on mobile app, hide manually
		try {
			frameElement.parentNode.parentNode.style.display = "none";
		} catch (e){console.log("error while trying to close: " + e.message);}
	} else {
		try { // in case we are in mobile app, leverage mraid
			mraid.close();
		} catch (e){
			console.log("error while trying to close: " + e.message);
		}
	}
}

//get timer from url or use default
var timer = (parseInt(document.currentScript.src.substring(document.currentScript.src.indexOf("?") + 1)) || 5) * 1000;


// set timer to auto close interstitial
setTimeout(APNInterstitialClose, timer);
var img = document.createElement("img");
img.style.cssText = "width: 25px; height: 25px; position: absolute; top: 10px; right: 10px; cursor: pointer;";
img.onclick = APNInterstitialClose;
img.src = "data:image/png;base64,";
document.body.append(img);